// QueryHistory.js
import React, { useEffect, useState } from "react";
import axios from "axios";

const QueryHistory = ({ userId, refresh }) => {
  const [queryHistory, setQueryHistory] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchQueryHistory = async () => {
    const token = localStorage.getItem("jwtToken");
    if (!userId) return;

    try {
      setLoading(true);
      const response = await axios.get(`http://localhost:9000/query-history/${userId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setQueryHistory(response.data);
      setLoading(false);
    } catch (err) {
      console.error("Error fetching query history:", err);
      setError("Failed to load query history.");
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchQueryHistory();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [userId, refresh]); // Re-fetch when userId or refresh changes

  if (loading) return <p>Loading query history...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div>
      <h3>Query History</h3>
      {queryHistory.length === 0 ? (
        <p>No queries found for this employee.</p>
      ) : (
        <ul>
          {queryHistory.map((query) => (
            <li key={query.recordId}>
              <strong>Query:</strong> {query.query}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default QueryHistory;
